import {React, Component} from 'react'
import firebase from "../firebase";


import '../index.css';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Redirect,
    Link
  } from "react-router-dom";
import Admin from '../Admin/Admin';


class Login extends Component{
    constructor(propes){
        super(propes)
        this.login = this.login.bind(this);
        this.handleChange = this.handleChange.bind(this);
        this.singup = this.singup.bind(this);
        this.state={
            email : "",
            password : ""
        }
    }

    login(e){
        e.preventDefault();
        firebase.auth().signInWithEmailAndPassword(this.state.email,this.state.password).then((u)=>{
            console.log(u);
        }).catch((err)=>{
            console.log(err);
        })
    }

    singup(e){
        e.preventDefault();
        firebase.auth().createUserWithEmailAndPassword(this.state.email,this.state.password).then((u)=>{
            console.log(u);
        }).catch((err)=>{
            console.log(err);
        })
    }

    handleChange(e){
        this.setState({
            [e.target.name] : e.target.value
        })
    }

    render(){
        return(
            <>
           
               
            <div className="bgcolor row vh-100">
                 
                 
                 <div className="part1 col-md-6 d-flex justify-content-center align-items-center">
                     
                         <h1 className="title fw-bold">ADCET Paymentor</h1>
                     
                 </div>
                 
                 <div className="part2 col-md-6 bg-white br d-flex flex-column justify-content-start justify-content-md-center align-items-center">
                 <Router>
                     
                 <Link to="/adminlogin" className="position-absolute top-0 end-0 me-4 mt-4" ><button type="button" className="btn btn-outline-primary rounded-pill">Admin Login</button></Link>

                 <Switch>
                     <Route path="/adminlogin">
                             <Admin />
                     </Route>
                 </Switch>

                 </Router>
                     <div className="form">
                             <div className="l-title">
                                 <h5 className="fw-bold mb-4 fs-3">Log in</h5>
                             </div>

                         <form className="d-flex flex-column align-items-center" action="#" method="post">
                         
                                 <div class="form-group mb-3">
                                     <input type="text" class="form-control" name="username" id="username" placeholder="username" />
                                 </div>
                                 <div class="form-group mb-5">
                                     <input type="password" class="form-control" name="password" id="password" placeholder="password"/>
                                 </div>
                                 <input className="btn btn-primary px-4 py-2" type="button" value="Login" />
                         </form>
                         
                     </div>
                             

                 </div>
                
                 
